import { StyleSheet } from "react-native";

export const styles = StyleSheet.create({
  footer: {
    flexDirection: "row",
    alignItems: "center",
    justifyContent: "space-between",
    backgroundColor: "#EF6C00",
    paddingTop: 210,
    paddingHorizontal: 30,
  },
  imagePix: {
    borderRadius: 20,
    width: 45,
    height: 45,
  },
  imageItoken: {
    borderRadius: 20,
    width: 45,
    height: 27,
    marginBottom: 6,
  },
  imageAjuda: {
    borderRadius: 10,
    width: 40,
    height: 40,
    marginBottom: 5,
  },
  text1Footer: {
    color: "#FAFAFA",
    fontWeight: "bold",
    textAlign: "center",
    marginBottom: 20,
  },
  text2Footer: {
    color: "#FAFAFA",
    fontWeight: "bold",
    textAlign: "center",
    marginBottom: 8,
  },
  text3Footer: {
    color: "#FAFAFA",
    fontWeight: "bold",
    textAlign: "center",
    marginBottom: 20,
  },
});
